import './horseRow.css';

const HorseRow = ({ horse, onChange }) => {
  const {id, name, amount, odds} = horse;
  return (
    <div className="row">
      <div>{name}</div>
      <div>{odds}</div>

      <div className="buttonWrapper">
        <button onClick={() => onChange(5)}>+</button>
        <button onClick={() => onChange(-5)}>-</button>
      </div>

      <div>{amount}</div>
    </div>
  );
};

export default HorseRow;
